INSERT INTO `package_features` (`id`, `en_name`, `bn_name`, `status`, `created_at`, `updated_at`) VALUES
(1, 'If customer\'s name and address are added to the balance at the time of sale, the balance ledger will automatically be opened in the name of that customer. You can pay the reminder in any media.', 'বাকিতে বিক্রির সময় কাষ্টমারের নাম, ঠিকানা যোগ করলে স্বয়ংক্রিয়ভাবে ঐ কাস্টমারের নামে বাকীর লেজার ওপেন হয়ে যাবে। যে কোন মিডিয়ায় বাকীর তাগাদা দিতে পারবেন।', 1, '2022-11-19 05:45:30', '2023-08-07 08:18:17'),
(2, 'Stock:Stock will be generated automatically as soon as the purchase is accounted for. You can see stock updates at any time. It always takes hours to match stocks, here you can match stocks in seconds.', 'স্টক:ক্রয়ের হিসাব রাখার সাথে সাথে স্বয়ংক্রিয়ভাবে স্টক তৈরি হয়ে যাবে। যে কোন সময় স্টকের আপডেট দেখতে পারবেন। সব সময় স্টক মিলাতে ঘন্টার পর ঘন্টা লেগে যায়  এখানে কয়েক সেকেন্ডের মধ্যেই স্টকের হিসাব মিলাতে পারবেন।', 1, '2022-11-19 05:47:22', '2023-08-10 07:36:35'),
(3, 'You can sell thousands of money in a few seconds.', 'কয়েক সেকেন্ডের মধ্যে হাজার হাজার টাকার বিক্রি সম্পন্ন করতে পারবেন।', 1, '2022-11-19 05:48:15', '2023-08-07 08:20:45'),
(4, 'You can keep account of purchase and sale very easily.', 'খুব সহজেই ক্রয়-বিক্রয়ের হিসাব রাখতে পারবেন।', 1, '2022-11-19 05:48:42', '2023-08-07 08:16:58'),
(5, 'A profit and loss ledger will be generated automatically.', 'স্বয়ংক্রিয়ভাবে লাভ-ক্ষতির লেজার তৈরি হয়ে যাবে।', 1, '2023-08-05 06:39:55', '2023-08-07 08:18:51'),
(6, 'You can monitor your business from anywhere in the world.', 'পৃথিবীর যে কোন জায়গা থেকে আপনার ব্যবসা মনিটর করতে পারবেন।', 1, '2023-08-07 08:16:14', '2023-08-07 08:16:14'),
(7, 'Even if the phone is lost or damaged, no problem, you will not lose your account.', 'ফোন হারিয়ে বা নষ্ট হয়ে গেলেও সমস্যা নাই আপনার হিসাব হারাবেনা।', 1, '2023-08-07 08:26:06', '2023-08-07 08:26:06'),
(8, 'Your business information is 100% safe and secure.', 'আপনার ব্যবসার তথ্য ১০০% নিরাপদ এবং সুরক্ষিত।', 1, '2023-08-07 08:27:30', '2023-08-07 08:27:30'),
(9, 'Purchase: You can keep your business purchase account. How much from any supplier? You can keep track of which products you have bought.', 'ক্রয়:আপনার ব্যবসার ক্রয় হিসাব রাখতে পারবেন। কোন সাপ্লায়ের কাছ থেকে কত টাকার কোন পণ্য কিনেছেন তার হিসাব রাখতে পারবেন।', 1, '2023-08-10 06:51:27', '2023-08-10 06:51:27'),
(10, 'Sales', 'বিক্রয়', 1, '2023-08-10 08:04:21', '2023-09-05 06:51:58'),
(11, 'Feature', 'ফিচার', 1, '2023-09-05 05:56:06', '2023-09-05 05:56:06'),
