(1, 'Refund policy and Cencelation policy', '<p><font color=\"#000000\"><b>Refund policy and Cencelation Policy</b></font></p><p><font color=\"#000000\"><b>If you are dissatisfied at any time,during your first month using our mobile application</b></font></p><p><font color=\"#000000\"><b>“gmanager”,please let us know your concern.We will do our our best to address your</b></font></p><p><font color=\"#000000\"><b>concern,provide a solution,workaround or give a timeline for a provide a solution that meet your</b></font></p><p><font color=\"#000000\"><b>needs.If you are still not satisfied, we will gladly offer you a full refund for your purchase,and</b></font></p><p><font color=\"#000000\"><b>downgrade your account to the free plan for that service with limited or no access.</b></font></p><p><font color=\"#000000\"><b>The refund request should be satisfied via email.Refund policy will be applicable only for</b></font></p><p><font color=\"#000000\"><b>purchase equal.</b></font></p><p><font color=\"#000000\"><b>Any query please drop us an e-mail at gmanagerhrm@gmail.com</b></font></p><p><br></p><p><font color=\"#000000\"><b><br></b></font></p><p><br></p><p><br></p>', 'Refund policy and Cencelation Policy', '<p><font color=\"#000000\"><span style=\"font-weight: bolder;\">Refund policy and Cencelation Policy</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">If you are dissatisfied at any time,during your first month using our mobile application</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">“gmanager”,please let us know your concern.We will do our our best to address your</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">concern,provide a solution,workaround or give a timeline for a provide a solution that meet your</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">needs.If you are still not satisfied, we will gladly offer you a full refund for your purchase,and</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">downgrade your account to the free plan for that service with limited or no access.</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">The refund request should be satisfied via email.Refund policy will be applicable only for</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">purchase equal.</span></font></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\">Any query please drop us an e-mail at gmanagerhrm@gmail.com</span></font></p><p><br></p><p><font color=\"#000000\"><span style=\"font-weight: bolder;\"><br></span></font></p><p><br></p><p><br></p>', 'refund-policy-and-cencelation-policy', 1, '2023-06-08 11:37:53', '2023-09-08 13:38:04'),
(2, 'Terms and conditions', '<p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">100% Advance payment compulsory-govt vat+application charge</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">If any amount incurred towards govt. fees such amount will be deducted from from fees.</span></font></p>', 'শর্তাবলী', '<pre class=\"tw-data-text tw-text-large tw-ta\" data-placeholder=\"Translation\" id=\"tw-target-text\" dir=\"ltr\" style=\"unicode-bidi: isolate; font-size: 28px; line-height: 32px; background-color: rgb(248, 249, 250); border: none; padding: 2px 0.14em 2px 0px; position: relative; margin-top: -2px; margin-bottom: -2px; resize: none; font-family: inherit; overflow: hidden; width: 270px; text-wrap: wrap; overflow-wrap: break-word; color: rgb(32, 33, 36);\"><p style=\"color: rgb(33, 37, 41); font-size: 16px; white-space-collapse: collapse; background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">100% Advance payment compulsory-govt vat+application charge</span></font></p><p style=\"color: rgb(33, 37, 41); font-size: 16px; white-space-collapse: collapse; background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">If any amount incurred towards govt. fees such amount will be deducted from from fees.</span></font></p></pre>', 'terms-and-conditions', 1, '2023-06-08 11:37:53', '2023-08-14 05:14:37'),
(3, 'Privacy policy', '<p style=\"background-color: rgba(0, 0, 0, 0.05);\"><br></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">&nbsp;Legal Disclaimer</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">Though we make every effort to preserve user privacy, we may need to disclose personal information when</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">required by law wherein we have a good-faith belief that such action is necessary to comply with a current</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">judicial proceeding, a court order or legal process served on our Web site. For example, HostBooks may</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">disclose personal information to law enforcement, other government officials, or third parties in response to</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">criminal or civil subpoenas.</span></font></p>', 'Privacy policy', '<p><br></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">&nbsp;Legal Disclaimer</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">Though we make every effort to preserve user privacy, we may need to disclose personal information when</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">required by law wherein we have a good-faith belief that such action is necessary to comply with a current</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">judicial proceeding, a court order or legal process served on our Web site. For example, HostBooks may</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">disclose personal information to law enforcement, other government officials, or third parties in response to</span></font></p><p style=\"background-color: rgba(0, 0, 0, 0.05);\"><font color=\"#000000\"><span style=\"font-weight: bolder;\">criminal or civil subpoenas.</span></font></p>', 'privacy-policy', 1, '2023-08-14 05:21:58', '2023-08-14 05:21:58'),
(4, 'Address', '<p><b style=\"font-size: 1rem;\">&nbsp;Office:Dhanbari Bazar,Dhanbari,Tangail</b></p><p><b style=\"font-size: 1rem;\">E-mail:gmanagerteam@gmail.com</b></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<b> &nbsp;gmangerhrm@gmail.com</b></p>', 'Address', '<p><b style=\"font-size: 1rem;\">&nbsp;Office:Dhanbari Bazar,Dhanbari,Tangail&nbsp;</b></p><p><span style=\"font-weight: bolder; font-size: 1rem;\">E-mail:gmanagerteam@gmail.com</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-weight: bolder;\">&nbsp;&nbsp;gmangerhrm@gmail.com</span></p><p><br></p>', 'address', 1, '2023-08-16 07:58:24', '2023-09-08 13:36:02');
